import React,{ Component } from 'react'
 
class Coin extends Component{
  render(){
    return(
      <div class='Coin' style={{textAlign:'center'}}>
        <img
          style={{ width:'200px', height:'200px' }}
          src={this.props.info.imgSrc}
        />
      </div>
    )
  }
}
 
export default Coin
